import './AddDive.css';
import { useNavigate, Navigate } from "react-router-dom";

function App() {
    const navigate = useNavigate();
  return (    
    <form>  
        <button className='neon-btn' onClick={navigate('/student')}>Back</button>
    <div className='main-AddDive'>
      <div>
        Number of Diving: <input type="text" className='block'/>
        Date: <input required type="Date"/>
      </div>
      <div>
        Site: <input required type="text" className='block'/>
        Special equipment: <input type="text"/>
      </div>
      <div>
        Dive duration (minutes): <input required type="number" className='block'/>
        Depth (m) = <input required type="number"/>
      </div>
      <div>
        Note:<br/>
        <textarea rows='5'></textarea>
      </div>
      <button className='neon-btn'>Add Dive</button>
    </div>
    </form>
  );
}

export default App;
